import React from 'react';
import Menu from '../components/menu';

function contato(props) {
    return (
        <>
            <Menu title="Contato - Alex Ricardo" description="Alex Ricardo desenvolvedor web" />
            <h1>Contato</h1>
        </>
    );
}

export default contato;
